import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function HTMLTest() {
  function handleClick() {
    HTMLCall();
  }

  return (
    <>
      <button onClick={handleClick}>TEST ADD</button>
    </>
  );
}

function HTMLCall() {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get('https://localhost/data')
      .then(response => {
        setData(response.data); // Axios automatically parses JSON
      })
      .catch(error => {
        setError(error.message);
      });
  }, []);
}

function App() {

  return (
    <div className="test">
      <HTMLTest />
    </div>
  );
}

export default App;
